  <!-- Camera viewer -->


  <div id="CameraViewerDlg" class="Modal_Screen blue">
    <div class="CameraViewer_Dlg">
      <!-- caption -->
      <div class="CameraViewer_Name"><span></span><span id="ViewerNameTop"></span><span></span></div>
      <div class="CameraViewer_Name"><span></span><span id="ViewerNameSide"></span><span></span></div>
      <!--  Top and side  Camera viewer -->
      <div class="CameraViewer">
        <img id="topCameraView" alt="Camera Viewer Top" class="CameraViewer_Canvas" src="asset/img/CameraViewerTop.png?n=15">
      </div>
      <div class="CameraViewer">
        <img id="sideCameraView" alt="Camera Viewer Side" class="CameraViewer_Canvas" src="asset/img/CameraViewerSide.png?n=15">
      </div>
      <!-- button quit -->
      <div class="CameraViewer_Button ButtonBar">
        <button class="StandardButton small" id="CameraViewerCloseBtn">
          <img alt="x" src="asset/img/ICO_Close.png?n=15">Close
        </button>
      </div>
    </div>
  </div>




  <div class="Modal_Screen blue">
    <div class="Modal_Dlg" id="WorkflowBarModal_Dlg">


      <div class="title">new popin modal</div>
      <div class="left-box-status none" id="WorkflowBariconStatus">

        <div class="timer play">
          <div id="WorkflowBarCountDownContainer"></div>
          <div class="spinner-count" id="WorkflowBartimer"></div>
        </div>

        <div class="warning">
          <img alt="Warning" src="asset/img/ICO_Warning.svg?n=16">
        </div>
        <div class="question">
          <img alt="Question" src="asset/img/ICO_Question.svg?n=16">
        </div>
        <div class="info">
          <img alt="Info" src="asset/img/ICO_Instruction.svg?n=16">
        </div>
        <div class="error">
          <img alt="Error" src="asset/img/ICO_ExamStatus_Error.svg?n=16">
        </div>

        <div class="success">
          <img alt="Success" src="asset/img/UI_CheckMark.svg?n=16">
        </div>

        <div class="valid">
          <img alt="valid" src="asset/img/ICO_Checked_Orange.svg?n=16">
        </div>

        <div class="progress">
          <img alt="Progress" src="asset/img/ICO_Progress.svg?n=16">
        </div>
        <div class="wait play">
          <div></div>
          <div class="spinner-count" id="WorkflowBarwait"></div>
        </div>
        <div class="input">
          <img alt="Input" src="asset/img/ICO_Movment.png?n=16">
        </div>
      </div>


      <div class="Instructions Instructions-1" id="WorkflowBarPrimaryMessage"></div>
      <div class="Instructions Instructions-2 SuperSmall"><span id="WorkflowBarSecondaryMessage"></span></div>

      <div class="ButtonBar Horizontal ">
        <button class="StandardButton long-adjust hide"></button>
      </div>
    </div>
  </div>


  <link href="asset/css/ScDialog.css" rel="stylesheet">
